  <p>
    <strong>Aplic\u0103 organizarea meselor zilnice cu planificatorul nostru s\u0103pt\u0103m\xE2nal!</strong> Descoper\u0103 re\u021Bete tradi\u021Bionale \u0219i moderne din toate col\u021Burile lumii \u2013 de la preparate rom\xE2ne\u0219ti \u0219i italiene, p\xE2n\u0103 la m\xE2nc\u0103ruri asiatice \u0219i deserturi americane. Planific\u0103 meniul fiec\u0103rei zile, adaug\u0103 re\u021Bete \u0219i ingrediente, iar la final ob\u021Bii automat lista de cump\u0103r\u0103turi pentru \xEEntreaga s\u0103pt\u0103m\xE2n\u0103, gata de tip\u0103rit sau salvat PDF.
  </p>
  <p>
